class Solution:
    def sumEvenAfterQueries(self, nums: 'List[int]', queries: 'List[List[int]]') -> 'List[int]': # O( N | N )
        output = [] 
        total = sum(n for n in nums if n % 2 == 0)
        for v, i in queries:
            prev = nums[i] # previous nums[i] value
            nums[i] += v 
            if nums[i] % 2 == 0: # if current is even, add the v to the total 
                total += (v if prev % 2 == 0 else nums[i]) # if prev is odd, need to add the number, else, just add the delta
            elif prev % 2 == 0:
                total -= prev # else, remove prev from total, if prev is even
            output.append(total)
        
        return output

    


